import React from "react";

export default function Groups({ groupNumber }) {
  return (
    <>
      <div
        className={`groups {groupNumber}`}
        style={{
          gridRow: 1,
          gridColumn: { groupNumber },
        }}
      >
        {groupNumber}
      </div>
    </>
  );
}
